import { icons } from '../../constant/reacticonConstant/index';
import {Facility, RoomData} from '../../type/index';

//stylesheet
import './index.scss';

const Amenities= ({facilitiesEntityList,minCapacity,maxCapacity}:RoomData) => {
  return (
    <div className='Amenities_content'>
        <div className='Amenities_item'>
        <icons.BsFillPeopleFill className='icon'/>
        <h6>{minCapacity}-{maxCapacity}</h6>
      </div>
      {facilitiesEntityList?.map((i:Facility)=>(
           <div key={i.facilityName} className='Amenities_item'>
              <img src={i.iconUrl} alt='loading'/>
              <h6>{i.facilityName}</h6>
            </div>     
      ))}
     </div>
  )
}
export default Amenities
